import { useState, FormEvent } from 'react';
import { useNavigate } from 'react-router-dom';
type Props = {
    token: string
  };
export const DeleteCompany = (props: Props) => {
  const navigate = useNavigate();
  const [id, setId] = useState<number>(0);

  const deleteCompany = (event: FormEvent<HTMLFormElement>): void => {
    event.preventDefault();
    fetch('http://localhost:8080/admin/company/delete?id=' + id, {
      method: 'POST',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).catch((error) => console.log(error));
  }

  return (
    <div className='delete-company'>
      <button onClick={() => navigate(-1)}>Back</button> {/* add "Back" button */}
      {
      <form onSubmit={deleteCompany}>
        <label>id: </label>
        <input type="id" value={id} onChange={(event) => setId(parseInt(event.target.value))}  />
        <button type="submit">delete Company</button>
      </form>}
    </div>
  )
}

export default DeleteCompany ;
